script: |
  super -f text -I q10056.spq | sort > q10056.out

inputs:
  - name: q10056.spq
    data: |
      SELECT DISTINCT + 13 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 29 - 71 / col2 + + col2 * - col0 IN ( - ( - col2 ) * - col0 );
  - name: tab2

outputs:
  - name: q10056.out
    data: |
      13
